import React from 'react';
import { NavLink } from 'react-router-dom';


const Home=()=> {
  return (
    
      <>
      <div className="container-fluid mb-auto">
          <div className="row">
              <div className="col-10 mx-auto  d-flex">
                  <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex flex-column">
                      <h1>Grow your business with <strong>Jaskirat Singh</strong></h1>
                      <h2 className="my-2"> we are a team of some good developer to making website</h2>
                     <div className="mt-3">
                         
                         
                    <NavLink to="/service" className="btn btn-primary">Get Started</NavLink> </div>
                  </div>

              </div>
          </div>
      </div>
       
     
    </>
  );
}

export default Home;
